<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Valentine's Card - Vanesa</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Comic Sans MS', cursive, sans-serif;
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
            background: linear-gradient(135deg, #ffb3d9 0%, #ffc9e3 50%, #ffd9ec 100%);
            overflow: hidden;
            padding: 20px;
        }

        .card-container {
            position: relative;
            width: 90%;
            max-width: 600px;
            animation: cardEntry 1s ease-out;
        }

        @keyframes cardEntry {
            from {
                opacity: 0;
                transform: scale(0.8) rotateY(180deg);
            }
            to {
                opacity: 1;
                transform: scale(1) rotateY(0deg);
            }
        }

        .card-image {
            width: 100%;
            height: auto;
            border-radius: 30px;
            box-shadow: 0 20px 60px rgba(255, 105, 180, 0.4);
            animation: float 3s ease-in-out infinite;
        }

        @keyframes float {
            0%, 100% { 
                transform: translateY(0px) rotate(0deg);
            }
            50% { 
                transform: translateY(-15px) rotate(1deg);
            }
        }

        .buttons-overlay {
            position: absolute;
            bottom: 8%;
            left: 50%;
            transform: translateX(-50%);
            display: flex;
            gap: 15px;
            z-index: 10;
        }

        .btn {
            padding: 15px 45px;
            font-size: 1.6em;
            font-weight: bold;
            border: none;
            border-radius: 50px;
            cursor: pointer;
            transition: all 0.3s;
            box-shadow: 0 8px 20px rgba(0,0,0,0.3);
            font-family: 'Comic Sans MS', cursive, sans-serif;
            animation: buttonPulse 2s infinite;
        }

        @keyframes buttonPulse {
            0%, 100% { transform: scale(1); }
            50% { transform: scale(1.05); }
        }

        .btn-yes {
            background: linear-gradient(135deg, #90EE90 0%, #98FB98 100%);
            color: #2d5016;
            border: 4px solid #6b8e4e;
        }

        .btn-yes:hover {
            transform: scale(1.15) rotate(-5deg);
            box-shadow: 0 12px 35px rgba(144, 238, 144, 0.6);
            animation: none;
        }

        .btn-no {
            background: linear-gradient(135deg, #ff69b4 0%, #ff85c1 100%);
            color: white;
            border: 4px solid #ff1493;
        }

        .btn-no:hover {
            transform: scale(0.95);
            opacity: 0.9;
        }

        .floating-hearts {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            pointer-events: none;
            z-index: 5;
        }

        .heart {
            position: absolute;
            font-size: 30px;
            opacity: 0;
            animation: floatUp 4s infinite ease-in;
        }

        @keyframes floatUp {
            0% {
                opacity: 0;
                transform: translateY(100vh) rotate(0deg);
            }
            10% {
                opacity: 0.8;
            }
            90% {
                opacity: 0.8;
            }
            100% {
                opacity: 0;
                transform: translateY(-100px) rotate(360deg);
            }
        }

        .sparkle {
            position: fixed;
            width: 6px;
            height: 6px;
            background: white;
            border-radius: 50%;
            pointer-events: none;
            animation: sparkleAnimation 1.5s infinite;
            z-index: 15;
        }

        @keyframes sparkleAnimation {
            0%, 100% { 
                opacity: 0; 
                transform: scale(0) rotate(0deg);
                box-shadow: 0 0 0 white;
            }
            50% { 
                opacity: 1; 
                transform: scale(1.5) rotate(180deg);
                box-shadow: 0 0 20px white;
            }
        }

        .response-overlay {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(255, 182, 193, 0.95);
            display: none;
            justify-content: center;
            align-items: center;
            z-index: 100;
            animation: fadeIn 0.5s;
        }

        @keyframes fadeIn {
            from { opacity: 0; }
            to { opacity: 1; }
        }

        .response-overlay.show {
            display: flex;
        }

        .response-content {
            text-align: center;
            animation: popIn 0.6s cubic-bezier(0.68, -0.55, 0.265, 1.55);
        }

        @keyframes popIn {
            0% {
                transform: scale(0) rotate(-180deg);
                opacity: 0;
            }
            100% {
                transform: scale(1) rotate(0deg);
                opacity: 1;
            }
        }

        .response-text {
            font-size: 3em;
            font-weight: bold;
            color: #c41e3a;
            text-shadow: 3px 3px 6px rgba(0,0,0,0.3);
            margin-bottom: 20px;
        }

        .response-emoji {
            font-size: 6em;
            animation: spin 2s linear infinite;
        }

        @keyframes spin {
            from { transform: rotate(0deg); }
            to { transform: rotate(360deg); }
        }

        .confetti {
            position: fixed;
            width: 12px;
            height: 12px;
            z-index: 99;
            animation: confettiFall 3s linear forwards;
        }

        @keyframes confettiFall {
            0% {
                transform: translateY(-100vh) rotate(0deg);
                opacity: 1;
            }
            100% {
                transform: translateY(100vh) rotate(720deg);
                opacity: 0;
            }
        }

        .close-btn {
            margin-top: 30px;
            padding: 15px 40px;
            font-size: 1.4em;
            background: white;
            color: #c41e3a;
            border: 3px solid #c41e3a;
            border-radius: 30px;
            cursor: pointer;
            font-weight: bold;
            transition: all 0.3s;
        }

        .close-btn:hover {
            background: #c41e3a;
            color: white;
            transform: scale(1.1);
        }

        /* Love Calculator Styles */
        .love-calculator {
            background: white;
            padding: 40px;
            border-radius: 30px;
            box-shadow: 0 10px 40px rgba(0,0,0,0.2);
            max-width: 500px;
            width: 90%;
        }

        .calculator-title {
            font-size: 2.5em;
            color: #ff1493;
            margin-bottom: 10px;
            text-shadow: 2px 2px 4px rgba(255,20,147,0.3);
        }

        .calculator-subtitle {
            font-size: 1.2em;
            color: #c41e3a;
            margin-bottom: 30px;
        }

        .love-meter-container {
            margin: 30px 0;
        }

        .meter-label {
            font-size: 1.3em;
            color: #666;
            margin-bottom: 15px;
        }

        .meter-bar {
            width: 100%;
            height: 50px;
            background: linear-gradient(to right, #ffebee, #ffcdd2);
            border-radius: 25px;
            overflow: hidden;
            position: relative;
            box-shadow: inset 0 2px 5px rgba(0,0,0,0.1);
        }

        .meter-fill {
            height: 100%;
            width: 0%;
            background: linear-gradient(to right, #ff69b4, #ff1493, #c41e3a);
            border-radius: 25px;
            transition: width 3s cubic-bezier(0.68, -0.55, 0.265, 1.55);
            position: relative;
            overflow: hidden;
        }

        .meter-fill::before {
            content: '';
            position: absolute;
            top: 0;
            left: -100%;
            width: 100%;
            height: 100%;
            background: linear-gradient(90deg, transparent, rgba(255,255,255,0.3), transparent);
            animation: shimmer 2s infinite;
        }

        @keyframes shimmer {
            0% { left: -100%; }
            100% { left: 100%; }
        }

        .meter-percentage {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-size: 1.8em;
            font-weight: bold;
            color: white;
            text-shadow: 2px 2px 4px rgba(0,0,0,0.5);
            z-index: 2;
        }

        .calculating-text {
            font-size: 1.5em;
            color: #ff69b4;
            margin: 20px 0;
            animation: blink 1s infinite;
        }

        @keyframes blink {
            0%, 100% { opacity: 1; }
            50% { opacity: 0.5; }
        }

        .result-text {
            font-size: 2em;
            color: #2d5016;
            font-weight: bold;
            margin: 20px 0;
            opacity: 0;
            transform: scale(0);
            transition: all 0.5s cubic-bezier(0.68, -0.55, 0.265, 1.55);
        }

        .result-text.show {
            opacity: 1;
            transform: scale(1);
        }

        .love-facts {
            margin-top: 30px;
            text-align: left;
            background: #fff0f5;
            padding: 20px;
            border-radius: 15px;
            opacity: 0;
            transform: translateY(20px);
            transition: all 0.5s ease;
        }

        .love-facts.show {
            opacity: 1;
            transform: translateY(0);
        }

        .love-facts h3 {
            color: #ff1493;
            margin-bottom: 15px;
            font-size: 1.5em;
        }

        .love-facts ul {
            list-style: none;
            padding: 0;
        }

        .love-facts li {
            padding: 10px 0;
            border-bottom: 1px solid #ffc0cb;
            color: #666;
            font-size: 1.1em;
        }

        .love-facts li:last-child {
            border-bottom: none;
        }

        .love-facts li::before {
            content: 'ðŸ’• ';
            margin-right: 10px;
        }

        @media (max-width: 600px) {
            .btn {
                padding: 12px 35px;
                font-size: 1.3em;
            }
            
            .buttons-overlay {
                gap: 10px;
            }

            .calculator-title {
                font-size: 2em;
            }

            .love-calculator {
                padding: 30px 20px;
            }
        }
    </style>
</head>

            <button class="btn btn-yes" onclick="handleYes()">Yes</button>
            <button class="btn btn-no" onclick="handleNo()">No</button>
        </div>

    <div class="response-overlay" id="responseOverlay">
        <div class="response-content" id="responseContent">
            <div class="response-emoji" id="responseEmoji"></div>
            <div class="response-text" id="responseText"></div>
            <button class="close-btn" onclick="closeResponse()">Close</button>
        </div>
    </div>

    <script>
        // Create floating hearts background
        const floatingHearts = document.getElementById('floatingHearts');
        const heartSymbols = ['ðŸ’•', 'ðŸ’–', 'ðŸ’—', 'ðŸ’“', 'ðŸ’', 'â¤ï¸', 'ðŸ’˜'];
        
        function createFloatingHeart() {
            const heart = document.createElement('div');
            heart.className = 'heart';
            heart.textContent = heartSymbols[Math.floor(Math.random() * heartSymbols.length)];
            heart.style.left = Math.random() * 100 + '%';
            heart.style.animationDelay = Math.random() * 4 + 's';
            heart.style.fontSize = (Math.random() * 20 + 20) + 'px';
            floatingHearts.appendChild(heart);
            
            setTimeout(() => heart.remove(), 4000);
        }

        setInterval(createFloatingHeart, 300);

        // Create sparkles
        function createSparkle(x, y) {
            const sparkle = document.createElement('div');
            sparkle.className = 'sparkle';
            sparkle.style.left = x + 'px';
            sparkle.style.top = y + 'px';
            document.body.appendChild(sparkle);
            
            setTimeout(() => sparkle.remove(), 1500);
        }

        // Random sparkles
        setInterval(() => {
            createSparkle(Math.random() * window.innerWidth, Math.random() * window.innerHeight);
        }, 500);

        function handleYes() {
            const overlay = document.getElementById('responseOverlay');
            const content = document.getElementById('responseContent');
            
            // Show love calculator
            content.innerHTML = `
                <div class="love-calculator">
                    <div class="calculator-title">ðŸ’• Love Calculator ðŸ’•</div>
                    <div class="calculator-subtitle">Calculating your compatibility...</div>
                    
                    <div class="love-meter-container">
                        <div class="meter-label">Love Match Percentage:</div>
                        <div class="meter-bar">
                            <div class="meter-fill" id="meterFill"></div>
                            <div class="meter-percentage" id="meterPercentage">0%</div>
                        </div>
                    </div>
                    
                    <div class="calculating-text" id="calculatingText">Analyzing hearts... ðŸ’—</div>
                    <div class="result-text" id="resultText"></div>
                    
                    <div class="love-facts" id="loveFacts">
                        <h3>Your Love Statistics:</h3>
                        <ul>
                            <li>Perfect Match Score: 100/100</li>
                            <li>Cuteness Level: Off the charts! ðŸ“ˆ</li>
                            <li>Happiness Probability: Guaranteed âœ¨</li>
                            <li>Future Together: Absolutely Magical ðŸŒŸ</li>
                        </ul>
                    </div>
                    
                    <button class="close-btn" onclick="closeResponse()">Amazing! ðŸ’–</button>
                </div>
            `;
            
            overlay.classList.add('show');
            
            // Start the love calculation animation
            setTimeout(() => {
                startLoveCalculation();
            }, 500);
            
            // Create confetti explosion
            for (let i = 0; i < 100; i++) {
                setTimeout(() => {
                    const confetti = document.createElement('div');
                    confetti.className = 'confetti';
                    confetti.style.left = Math.random() * 100 + '%';
                    confetti.style.top = '-10px';
                    confetti.style.background = ['#ff69b4', '#ff85c1', '#ffc0cb', '#ff1493', '#90EE90', '#FFD700', '#87CEEB'][Math.floor(Math.random() * 7)];
                    confetti.style.borderRadius = Math.random() > 0.5 ? '50%' : '0%';
                    confetti.style.animationDelay = Math.random() * 0.3 + 's';
                    document.body.appendChild(confetti);
                    
                    setTimeout(() => confetti.remove(), 3000);
                }, i * 20);
            }
        }

        function startLoveCalculation() {
            const meterFill = document.getElementById('meterFill');
            const meterPercentage = document.getElementById('meterPercentage');
            const calculatingText = document.getElementById('calculatingText');
            const resultText = document.getElementById('resultText');
            const loveFacts = document.getElementById('loveFacts');
            
            const messages = [
                'Analyzing hearts... ðŸ’—',
                'Measuring cuteness... ðŸ¥°',
                'Calculating chemistry... âœ¨',
                'Processing love signals... ðŸ’˜',
                'Final calculations... ðŸŽ¯'
            ];
            
            let currentMessage = 0;
            const messageInterval = setInterval(() => {
                currentMessage++;
                if (currentMessage < messages.length) {
                    calculatingText.textContent = messages[currentMessage];
                } else {
                    clearInterval(messageInterval);
                }
            }, 600);
            
            // Animate the meter to 100%
            let percentage = 0;
            const duration = 3000;
            const steps = 100;
            const stepTime = duration / steps;
            
            const fillInterval = setInterval(() => {
                percentage++;
                meterFill.style.width = percentage + '%';
                meterPercentage.textContent = percentage + '%';
                
                if (percentage >= 100) {
                    clearInterval(fillInterval);
                    
                    // Show final result
                    setTimeout(() => {
                        calculatingText.style.display = 'none';
                        resultText.textContent = 'ðŸŽ‰ Perfect Match! 100% Compatible! ðŸŽ‰';
                        resultText.classList.add('show');
                        
                        setTimeout(() => {
                            loveFacts.classList.add('show');
                        }, 500);
                    }, 500);
                }
            }, stepTime);
        }

        function handleNo() {
            const noBtn = event.target;
            const overlay = document.getElementById('responseOverlay');
            const content = document.getElementById('responseContent');
            
            // Make "No" button run away
            const maxX = window.innerWidth - noBtn.offsetWidth - 20;
            const maxY = window.innerHeight - noBtn.offsetHeight - 20;
            const randomX = Math.random() * maxX;
            const randomY = Math.random() * maxY;
            
            noBtn.style.position = 'fixed';
            noBtn.style.left = randomX + 'px';
            noBtn.style.top = randomY + 'px';
            noBtn.style.transition = 'all 0.3s ease';
            
            // Show encouraging message
            const messages = [
                { text: 'Are you sure? ðŸ¥º', emoji: 'ðŸ¥º' },
                { text: 'Please reconsider! ðŸ’”', emoji: 'ðŸ’”' },
                { text: 'The dino will be sad! ðŸ˜¢', emoji: 'ðŸ˜¢' },
                { text: 'Just click Yes! ðŸ’•', emoji: 'ðŸ¦•' },
                { text: 'Think about it! âœ¨', emoji: 'ðŸ¤”' }
            ];
            
            const message = messages[Math.floor(Math.random() * messages.length)];
            
            content.innerHTML = `
                <div class="response-emoji">${message.emoji}</div>
                <div class="response-text">${message.text}</div>
                <button class="close-btn" onclick="closeResponse()">Close</button>
            `;
            
            setTimeout(() => {
                overlay.classList.add('show');
                setTimeout(() => overlay.classList.remove('show'), 2000);
            }, 100);
        }

        function closeResponse() {
            document.getElementById('responseOverlay').classList.remove('show');
        }
    </script>
